svg.script:
	function serduszko(event) {
      if ((event.type == "click" && event.button == 0)) {
        var SVGDocument = event.target.ownerDocument;
		SVGDocument.getElementById("layer1").style.display="none";
		SVGDocument.getElementById("layer2").style.display="inline";
      }
    }
	function daga(event) {
      if ((event.type == "click" && event.button == 0)) {
        var SVGDocument = event.target.ownerDocument;
		SVGDocument.getElementById("layer1").style.display="inline";
		SVGDocument.getElementById("layer2").style.display="none";
      }
    }
